////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
/// ChiImageWarpNode::QueryBufferInfo
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
CDKResult ChiImageWarpNode::QueryBufferInfo(
    CHINODEQUERYBUFFERINFO* pQueryBufferInfo)
{
    CDKResult result                     = CDKResultSuccess;

    for (UINT32 i = 0; i < pQueryBufferInfo->numOutputPorts; i++)
    {
        CHINODEBUFFERREQUIREMENT* pInput0Options            = &pQueryBufferInfo->pInputOptions[0].inputBufferOption;
        CHINODEBUFFERREQUIREMENT* pInput1Options;
        if ((ChiNodeCapsEISDG == m_nodeCaps) || (ChiNodeCapsEISDGLDC == m_nodeCaps))
        {
            pInput1Options                                  = &pQueryBufferInfo->pInputOptions[1].inputBufferOption;
        }
        CHINODEBUFFERREQUIREMENT* pOutputOptions            = &pQueryBufferInfo->pOutputPortQueryInfo[i].outputBufferOption;
        CHINODEBUFFERREQUIREMENT* pOutputRequirement        = &pQueryBufferInfo->pOutputPortQueryInfo[i].pBufferRequirement[0];

        GetEisDGMargin();

        pInput0Options->optimalW                            = pOutputRequirement->optimalW;
        pInput0Options->optimalH                            = pOutputRequirement->optimalH;

        if ((ChiNodeCapsEISDG == m_nodeCaps) || (ChiNodeCapsEISDGLDC == m_nodeCaps))
        {
            pInput0Options->optimalW                       += static_cast<UINT32>
                                                              (pOutputRequirement->optimalW *
                                                              m_EISMarginRequest.widthMargin);
            pInput0Options->optimalH                       += static_cast<UINT32>
                                                              (pOutputRequirement->optimalH *
                                                              m_EISMarginRequest.heightMargin);
            pInput0Options->optimalW = ChiNodeUtils::AlignGeneric32(pInput0Options->optimalW, 4);
            pInput0Options->optimalH = ChiNodeUtils::AlignGeneric32(pInput0Options->optimalH, 4);
        }

        pInput0Options->minW                                = pOutputRequirement->minW;
        pInput0Options->minH                                = pOutputRequirement->minH;

        if ((ChiNodeCapsEISDG == m_nodeCaps) || (ChiNodeCapsEISDGLDC == m_nodeCaps))
        {
            pInput0Options->minW                           += static_cast<UINT32>
                                                              (pOutputRequirement->minW *
                                                              m_EISMarginRequest.widthMargin);
            pInput0Options->minH                           += static_cast<UINT32>
                                                              (pOutputRequirement->minH *
                                                              m_EISMarginRequest.heightMargin);
            pInput0Options->minW = ChiNodeUtils::AlignGeneric32(pInput0Options->minW, 4);
            pInput0Options->minH = ChiNodeUtils::AlignGeneric32(pInput0Options->minH, 4);
        }

        pInput0Options->maxW                                = pOutputRequirement->maxW;
        pInput0Options->maxH                                = pOutputRequirement->maxH;

        if ((ChiNodeCapsEISDG == m_nodeCaps) || (ChiNodeCapsEISDGLDC == m_nodeCaps))
        {
            pInput0Options->maxW                           += static_cast<UINT32>
                                                              (pOutputRequirement->maxW *
                                                              m_EISMarginRequest.widthMargin);
            pInput0Options->maxH                           += static_cast<UINT32>
                                                              (pOutputRequirement->maxH *
                                                              m_EISMarginRequest.heightMargin);
            pInput0Options->maxW = ChiNodeUtils::AlignGeneric32(pInput0Options->maxW, 4);
            pInput0Options->maxH = ChiNodeUtils::AlignGeneric32(pInput0Options->maxH, 4);
        }

        if ((ChiNodeCapsEISDG == m_nodeCaps) || (ChiNodeCapsEISDGLDC == m_nodeCaps))
        {
            pInput1Options->optimalW                        = pOutputRequirement->optimalW;
            pInput1Options->optimalH                        = pOutputRequirement->optimalH;
            pInput1Options->minW                            = pOutputRequirement->minW;
            pInput1Options->minH                            = pOutputRequirement->minH;
            pInput1Options->maxW                            = pOutputRequirement->maxW;
            pInput1Options->maxH                            = pOutputRequirement->maxH;
        }

        pInput0Options->planeAlignment[0].strideAlignment   = 128;
        pInput0Options->planeAlignment[0].scanlineAlignment = 32;
        pInput0Options->planeAlignment[1].strideAlignment   = 128;
        pInput0Options->planeAlignment[1].scanlineAlignment = 16;

        pOutputOptions->minW                                = pOutputRequirement->minW;
        pOutputOptions->minH                                = pOutputRequirement->minH;
        pOutputOptions->maxW                                = pOutputRequirement->maxW;
        pOutputOptions->maxH                                = pOutputRequirement->maxH;
        pOutputOptions->optimalW                            = pOutputRequirement->optimalW;
        pOutputOptions->optimalH                            = pOutputRequirement->optimalH;

        LOG_INFO(CamxLogGroupChi, "pInput0Options optimal %dx%d min %dx%d max %dx%d",pInput0Options->optimalW, pInput0Options->optimalH,
        pInput0Options->minW, pInput0Options->minH, pInput0Options->maxW, pInput0Options->maxH);

        LOG_INFO(CamxLogGroupChi, "pOutputOptions optimal %dx%d min %dx%d max %dx%d",pOutputOptions->optimalW, pOutputOptions->optimalH,
        pOutputOptions->minW, pOutputOptions->minH, pOutputOptions->maxW, pOutputOptions->maxH);

        pOutputOptions->planeAlignment[0].strideAlignment   = 128;
        pOutputOptions->planeAlignment[0].scanlineAlignment = 32;
        pOutputOptions->planeAlignment[1].strideAlignment   = 128;
        pOutputOptions->planeAlignment[1].scanlineAlignment = 16;

        LOG_VERBOSE(CamxLogGroupChi, "Output Plane 0 Stride alignment %d, Scanline alignment %d",
            pInput0Options->planeAlignment[0].strideAlignment, pInput0Options->planeAlignment[0].scanlineAlignment);

        LOG_VERBOSE(CamxLogGroupChi, "Output Plane 1 Stride alignment %d, Scanline alignment %d",
            pInput0Options->planeAlignment[1].strideAlignment, pInput0Options->planeAlignment[1].scanlineAlignment);

        m_outputFormat = pQueryBufferInfo->pOutputPortQueryInfo[i].outputBufferOption.format;

    }

    return result;
}

////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
/// ChiImageWarpNode::SetBufferInfo
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
CDKResult ChiImageWarpNode::SetBufferInfo(
    CHINODESETBUFFERPROPERTIESINFO* pSetBufferInfo)
{
    CHAR      setProp[PROPERTY_VALUE_MAX] = "";
    CDKResult result                      = CDKResultSuccess;
    BOOL      TuningDataAvailable         = FALSE;

    m_config_warp.perf_flag        = OpenGL_es_implementation;
    m_config_warp.enable_dithering = FALSE;

    property_get("persist.vendor.camera.iwarp.log", setProp, "0");
    m_config_warp.dbg_flag = atoi(setProp);

    ioteis_1_0_0::ioteis10Type* pChromatix = NULL;

    LOG_INFO(CamxLogGroupChi, "SetBufferInfo Width=%d, Height=%d, m_outputFormat=%d, perf_flag=%d",
        pSetBufferInfo->pFormat->width, pSetBufferInfo->pFormat->height,
        m_outputFormat, m_config_warp.perf_flag);

    m_inputWidth  = pSetBufferInfo->pFormat->width;
    m_inputHeight = pSetBufferInfo->pFormat->height;

    m_num_ver_x   = static_cast<int>(MESH_NUM_VER_X);
    m_num_ver_y   = static_cast<int>(MESH_NUM_VER_Y);

    if (ChiNodeCapsEISDG != m_nodeCaps)
    {
        CHIDATASOURCE chiDataSource;

        chiDataSource.dataSourceType     = ChiTuningManager;
        chiDataSource.pHandle            = NULL;
        TuningSetManager* pTuningManager = static_cast<TuningSetManager*>(g_ChiNodeInterface.pGetData(m_hChiSession,
                                                      &chiDataSource,
                                                      NULL,
                                                      NULL));

        CAMX_ASSERT(NULL != pTuningManager);

        if (NULL != pTuningManager)
        {
            ChiTuningModeParameter LDCTuningData;
            LDCTuningData.noOfSelectionParameter     = 1;
            LDCTuningData.TuningMode[0].mode         = ChiModeType::Default;
            LDCTuningData.TuningMode[0].subMode      = { 0 };
            pChromatix = pTuningManager->GetModule_ioteis10(
                                reinterpret_cast<TuningMode*>(&LDCTuningData.TuningMode[0]),
                                (sizeof(LDCTuningData.TuningMode)/sizeof(LDCTuningData.TuningMode[0])));

            if (NULL != pChromatix)
            {
                TuningDataAvailable = TRUE;
                LOG_INFO(CamxLogGroupChi, "LDC TuningData num_ver_x=%d, num_ver_y=%d, type=%d,",
                    pChromatix->LDC.ldc_mesh.num_ver_x, pChromatix->LDC.ldc_mesh.num_ver_y, pChromatix->LDC.ldc_mesh.type);

                LOG_INFO(CamxLogGroupChi, "LDC TuningData input_width=%d, input_height=%d, output_width=%d, output_height=%d",
                    pChromatix->LDC.ldc_mesh.input_width, pChromatix->LDC.ldc_mesh.input_height, pChromatix->LDC.ldc_mesh.output_width,
                    pChromatix->LDC.ldc_mesh.output_height);
            }
            else
            {

                LOG_INFO(CamxLogGroupChi, "LDC TuningData pChromatix is NULL, loading default values");
            }
        }
        else
        {
            LOG_ERROR(CamxLogGroupChi, "LDC TuningData TuningManager is NULL,  loading default values");
        }

        if (TRUE == TuningDataAvailable)
        {
            m_num_ver_x   = static_cast<int>(pChromatix->LDC.ldc_mesh.num_ver_x);
            m_num_ver_y   = static_cast<int>(pChromatix->LDC.ldc_mesh.num_ver_y);
        }
    }

    m_config_warp.num_ver_x        = m_num_ver_x;
    m_config_warp.num_ver_y        = m_num_ver_y;

    m_config_warp.malloc_ion          = ChiImageWarpNode::ImageWarpLibIonMalloc;
    m_config_warp.free_ion            = ChiImageWarpNode::ImageWarpLibIonFree;
    m_config_warp.completion_callback = ChiImageWarpNode::ImageWarpCompletionCallback;

    /* ION buffer */
    if (NULL == m_pImgBuffInfo)
    {
        LOG_VERBOSE(CamxLogGroupChi, "Opening ION device since fd is invalid");
        m_config_warp.ion_device_fd = ImageBufferOpen();

        if (m_config_warp.ion_device_fd < 0)
        {
            LOG_ERROR(CamxLogGroupChi, "Opening ION device failed");
            return CDKResultEFailed;
        }
    }

    m_ion_mmap_info.ion_device_fd = m_config_warp.ion_device_fd;
    m_ion_mmap_info.cached        = 0;

    result = static_cast<CDKResult>(m_ImageWarp_lib_init(m_handle, &m_config_warp));

    LOG_INFO(CamxLogGroupChi, "m_ImageWarp_lib_init return %d perf_flag =%d dbg_flag =%d", static_cast<int>(result),
        m_config_warp.perf_flag, m_config_warp.dbg_flag);

    m_buff_bundle.input_buf  = &m_input_buf;
    m_buff_bundle.output_buf = &m_output_buf;
    m_buff_bundle.mesh_buf   = &m_mesh_buf;

    m_buff_bundle.mesh_buf->width    = m_num_ver_x;
    m_buff_bundle.mesh_buf->height   = m_num_ver_y;
    m_buff_bundle.mesh_buf->stride   = (m_buff_bundle.mesh_buf->width)*sizeof(float)*2;// Align with 16, if needed later
    m_buff_bundle.mesh_buf->scanline = m_buff_bundle.mesh_buf->height;
    m_buff_bundle.mesh_buf->buf_size = (m_buff_bundle.mesh_buf->width)*(m_buff_bundle.mesh_buf->height)*sizeof(float)*2;

    if (ChiNodeCapsEISDG != m_nodeCaps)
    {
        result = ImageBufferGet(m_buff_bundle.mesh_buf->buf_size, &m_hMeshBuffer);

        if (CDKResultSuccess != result)
        {
            LOG_ERROR(CamxLogGroupChi, "Cannot allocate mesh buffer");
        }
        else
        {
            m_buff_bundle.mesh_buf->fd  = m_hMeshBuffer.bufferFd;
            m_buff_bundle.mesh_buf->buf = (VOID* )m_hMeshBuffer.pVirtualAddr;
            LOG_INFO(CamxLogGroupChi, "mesh buf w=%d, h=%d, st=%d, scl=%d, buf_size=%d, buf=%p,fd=%d",
                m_buff_bundle.mesh_buf->width, m_buff_bundle.mesh_buf->height, m_buff_bundle.mesh_buf->stride,
                m_buff_bundle.mesh_buf->scanline, m_buff_bundle.mesh_buf->buf_size,
                m_buff_bundle.mesh_buf->buf, m_buff_bundle.mesh_buf->fd);

            if (TRUE == TuningDataAvailable)
            {
                memcpy(m_buff_bundle.mesh_buf->buf, &pChromatix->LDC.ldc_mesh.mapping_tab.mapping, m_buff_bundle.mesh_buf->buf_size);
            }
            else
            {
                // Available meshes in the code are defaultMeshBuffer, rescaleMeshBuffer, LDCMeshBuffer
                memcpy(m_buff_bundle.mesh_buf->buf, &rescaleMeshBuffer, m_buff_bundle.mesh_buf->buf_size);
            }

            if (ChiNodeCapsEISDGLDC == m_nodeCaps)
            {
                m_meshfusion_config.ldc_mesh = (mesh_t*)malloc(sizeof(mesh_t));

                // m_meshfusion_config.ldc_mesh->mapping = (mesh_one_entry_t*)malloc(sizeof(mesh_one_entry_t)*m_num_ver_x*m_num_ver_y); // Needed for Non-Array init in mesh_fusion.h

                memcpy(m_meshfusion_config.ldc_mesh->mapping, m_buff_bundle.mesh_buf->buf, sizeof(float)*2*m_num_ver_x*m_num_ver_y);

                LOG_INFO(CamxLogGroupChi, "m_meshfusion_config.ldc_mesh->mapping [2] %f, [3] %f [4] %f",
                    *(reinterpret_cast<FLOAT*>(m_meshfusion_config.ldc_mesh->mapping)+2),
                    *(reinterpret_cast<FLOAT*>(m_meshfusion_config.ldc_mesh->mapping)+3),
                    *(reinterpret_cast<FLOAT*>(m_meshfusion_config.ldc_mesh->mapping) + 4));

                // m_meshfusion_config.super_view_mesh = (mesh_t*)malloc(sizeof(mesh_t));
                m_meshfusion_config.output_mesh = (mesh_t*)malloc(sizeof(mesh_t));
                m_meshfusion_config.eis_mesh = (mesh_t*)malloc(sizeof(mesh_t));
            }
        }
    }

    return result;
}

////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
/// ChiImageWarpNode::ImageBufferOpen
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
INT32 ChiImageWarpNode::ImageBufferOpen()
{

    m_pImgBuffInfo = (IMGBUFFERPRIVT *)calloc(1, sizeof(*m_pImgBuffInfo));
    if (NULL == m_pImgBuffInfo)
    {
        LOG_ERROR(CamxLogGroupChi, "Cannot allocate memory");
        return -1;
    }

    m_pImgBuffInfo->refCount = 0;
    m_pImgBuffInfo->ionFd = -1;

    // Open ION device
    m_pImgBuffInfo->ionFd = open("/dev/ion", O_RDONLY);

    if (m_pImgBuffInfo->ionFd < 0)
    {
        LOG_ERROR(CamxLogGroupChi, "Ion open failed");
        free(m_pImgBuffInfo);
        m_pImgBuffInfo = NULL;
        return -1;
    }

    m_pImgBuffInfo->refCount++;

    return m_pImgBuffInfo->ionFd;
}

////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
/// ChiImageWarpNode::ImageBufferGet
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
CDKResult ChiImageWarpNode::ImageBufferGet(
    INT32               length,
    IMGMEMHANDLET*      pHandle)
{
    IMGBUFFERT *pBuffer;

    if ((NULL == pHandle) || (length <= 0))
    {
        LOG_ERROR(CamxLogGroupChi, "Null check failed");
        return CDKResultEFailed;
    }

    pBuffer = (IMGBUFFERT*)malloc(sizeof(IMGBUFFERT));
    if (NULL == pBuffer)
    {
        LOG_ERROR(CamxLogGroupChi, "malloc failed");
        return CDKResultEFailed;
    }

    /* ION buffer */
    if (NULL == m_pImgBuffInfo)
    {
        LOG_VERBOSE(CamxLogGroupChi, "Opening ION device since fd is invalid");
        pBuffer->ionFd = ImageBufferOpen();

        if (pBuffer->ionFd < 0)
        {
            LOG_ERROR(CamxLogGroupChi, "Opening ION device failed");
            return CDKResultEFailed;
        }
    }
    else
    {
        pBuffer->ionFd  = m_pImgBuffInfo->ionFd;
    }

    pBuffer->allocData.len          = (UINT)length;
    pBuffer->allocData.flags        = 0;
    pBuffer->allocData.align        = 4096;

    pBuffer->allocData.heap_id_mask = (0x1 << ION_SYSTEM_HEAP_ID);

    /* Make it page size aligned */
    pBuffer->allocData.len          = (pBuffer->allocData.len + 4095) & (~4095U);
    INT32 result                    = ioctl(pBuffer->ionFd, ION_IOC_ALLOC, &pBuffer->allocData);
    if (result < 0)
    {
        LOG_ERROR(CamxLogGroupChi, "ioctl failure id : %d",result);
        return CDKResultEFailed;
    }

    struct ion_fd_data ion_info_fd;
    memset(&ion_info_fd, 0, sizeof(ion_info_fd));
    ion_info_fd.handle = pBuffer->allocData.handle;

    result = ioctl(pBuffer->ionFd, ION_IOC_SHARE, &ion_info_fd);
    if (result < 0) {
        LOG_ERROR(CamxLogGroupChi, "ioctl failure id : %d",result);
        return CDKResultEFailed;
    }

    pBuffer->pAddr                  = (uint8_t*)mmap(NULL, pBuffer->allocData.len,
                                                     PROT_READ | PROT_WRITE,
                                                     MAP_SHARED, ion_info_fd.fd, 0);
    pBuffer->buffFd                 = ion_info_fd.fd;

    if (MAP_FAILED == pBuffer->pAddr)
    {
        LOG_ERROR(CamxLogGroupChi, "Failure 05");
        return CDKResultEFailed;
    }

    pBuffer->cached                 = 0;

    pHandle->bufferFd               = pBuffer->buffFd;
    pHandle->pVirtualAddr           = (UCHAR*)pBuffer->pAddr;
    pHandle->length                 = (UINT)pBuffer->allocData.len;
    pHandle->phBufferHandle         = (VOID*)pBuffer;

    return CDKResultSuccess;
}

////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
/// ChiImageWarpNode::UpdateAdaptWindow
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
CDKResult ChiImageWarpNode::UpdateAdaptWindow(
    UINT64 requestId)
{
    IFECropInfo*     pIFEResidualCropInfo = NULL;
    IFECropInfo*     pIFEAppliedCropInfo  = NULL;
    IFEScalerInfo*   pIFEScalerInfo       = NULL;
    VOID*            pData                = NULL;
    CDKResult        result               = CDKResultSuccess;
    UINT32           temp_isp_start_x     = 0;
    UINT32           temp_isp_start_y     = 0;
    UINT32           temp_isp_end_x       = 0;
    UINT32           temp_isp_end_y       = 0;
    UINT32           isp_out_width        = 0;
    UINT32           isp_out_height       = 0;
    UINT32           need_update          = 0;
    FLOAT            IPEScalingFactor     = 1.0f;

    LOG_INFO(CamxLogGroupChi, "Input buffer WxH =%d,%d, Output buffer WxH =%d,%d",
             m_inputWidth, m_inputHeight, m_outputWidth, m_outputHeight);

    ///< Get Residual Crop Size
    pData = ChiNodeUtils::GetMetaData(requestId,
                                      g_vendorTagId.residualCropTagId,
                                      ChiMetadataDynamic,
                                      &g_ChiNodeInterface, m_hChiSession);
    if (NULL != pData)
    {
        pIFEResidualCropInfo = static_cast<IFECropInfo*>(pData);
        LOG_INFO(CamxLogGroupChi,
                    "IFE residual Crop info %d, %d, %d, %d",
                    pIFEResidualCropInfo->fullPath.left,
                    pIFEResidualCropInfo->fullPath.top,
                    pIFEResidualCropInfo->fullPath.width,
                    pIFEResidualCropInfo->fullPath.height);
    }

    ///< Get Applied Crop Size
    pData = ChiNodeUtils::GetMetaData(requestId,
                                      g_vendorTagId.appliedCropTagId,
                                      ChiMetadataDynamic,
                                      &g_ChiNodeInterface, m_hChiSession);
    if (NULL != pData)
    {
        pIFEAppliedCropInfo = static_cast<IFECropInfo*>(pData);

        LOG_INFO(CamxLogGroupChi,
                    "Applied Crop info %d, %d, %d, %d",
                    pIFEAppliedCropInfo->fullPath.left,
                    pIFEAppliedCropInfo->fullPath.top,
                    pIFEAppliedCropInfo->fullPath.width,
                    pIFEAppliedCropInfo->fullPath.height);
    }

    ///< Get IFE scaler info
    pData = ChiNodeUtils::GetMetaData(requestId,
                                      g_vendorTagId.scalerInfoTagId,
                                      ChiMetadataDynamic,
                                      &g_ChiNodeInterface, m_hChiSession);
    if (NULL != pData)
    {
        pIFEScalerInfo = static_cast<IFEScalerInfo*>(pData);

        LOG_INFO(CamxLogGroupChi,
                    "IFE scaler info input %dx%d, output %dx%d Scale factor %f",
                    pIFEScalerInfo->input.width,
                    pIFEScalerInfo->input.height,
                    pIFEScalerInfo->output.width,
                    pIFEScalerInfo->output.height,
                    pIFEScalerInfo->scalingFactor);
    }

    if (pIFEScalerInfo->scalingFactor <= 1.0f)
    {
        FLOAT ratio1 = static_cast<FLOAT>(pIFEResidualCropInfo->fullPath.width) / static_cast<FLOAT>(m_inputWidth);
        FLOAT ratio2 = static_cast<FLOAT>(pIFEResidualCropInfo->fullPath.height) / static_cast<FLOAT>(m_inputHeight);
        IPEScalingFactor = (ratio1 > ratio2) ? ratio2 : ratio1;
    }

    temp_isp_start_x = (ChiNodeUtils::EvenCeilingUINT32(static_cast<UINT32>(
                           static_cast<FLOAT>(pIFEAppliedCropInfo->fullPath.left) / pIFEScalerInfo->scalingFactor))) +
                       (ChiNodeUtils::EvenCeilingUINT32(static_cast<UINT32>(
                           static_cast<FLOAT>(pIFEResidualCropInfo->fullPath.left) / IPEScalingFactor)));
    temp_isp_start_y = (ChiNodeUtils::EvenCeilingUINT32(static_cast<UINT32>(
                           static_cast<FLOAT>(pIFEAppliedCropInfo->fullPath.top) / pIFEScalerInfo->scalingFactor))) +
                       (ChiNodeUtils::EvenCeilingUINT32(static_cast<UINT32>(
                           static_cast<FLOAT>(pIFEResidualCropInfo->fullPath.top) / IPEScalingFactor)));

    temp_isp_end_x = ChiNodeUtils::EvenCeilingUINT32(static_cast<UINT32>(
                         static_cast<FLOAT>(pIFEScalerInfo->output.width) / IPEScalingFactor));
    temp_isp_end_y = ChiNodeUtils::EvenCeilingUINT32(static_cast<UINT32>(
                         static_cast<FLOAT>(pIFEScalerInfo->output.height) / IPEScalingFactor));

    LOG_INFO(CamxLogGroupChi, "start_x %u end_y %u end_x %u end_y %u IPEScalingFactor %f",
                temp_isp_start_x, temp_isp_start_y, temp_isp_end_x, temp_isp_end_y, IPEScalingFactor);

    isp_out_width  = m_inputWidth;
    isp_out_height = m_inputHeight;

    //Check if we need to update adapt window for this request Id
    if (m_isp_window.input_width   != m_perSensorData.sensorDimension.width ||
        m_isp_window.input_height  != m_perSensorData.sensorDimension.height ||
        m_isp_window.output_width  != isp_out_width ||
        m_isp_window.output_height != isp_out_height ||
        m_isp_window.start_x       != temp_isp_start_x ||
        m_isp_window.start_y       != temp_isp_start_y ||
        m_isp_window.end_x         != temp_isp_end_x ||
        m_isp_window.end_y         != temp_isp_end_y )
    {
        need_update = 1;
    }

     ///< Get current FLL from sensor to check if there is any change
     pData = ChiNodeUtils::GetMetaData(requestId,
                                       g_vendorTagId.currentFLLTagId,
                                       ChiMetadataDynamic,
                                       &g_ChiNodeInterface,
                                       m_hChiSession);
     if (NULL != pData)
     {
         if (m_perSensorData.fll != *reinterpret_cast<UINT32 *>(pData))
         {
             m_perSensorData.fll = *reinterpret_cast<UINT32 *>(pData);
             LOG_INFO(CamxLogGroupChi, "FLL changed to %d", *reinterpret_cast<INT32*>(pData));
             need_update = 1;
         }
     } else {
        LOG_INFO(CamxLogGroupChi, "FLL pData is NULL");
     }

     if (need_update)
    {
        LOG_INFO(CamxLogGroupChi, "Doing UpdateAdaptWindow for frame %d",(int)requestId);

        // Need to read from chromatix later
        m_meshfusion_config.ldc_en = 1;
        m_meshfusion_config.sv_en  = 0;
        m_meshfusion_config.eis_en = 1;

        m_meshfusion_config.ldc_mesh->mesh_vertices_num_x = m_num_ver_x;
        m_meshfusion_config.ldc_mesh->mesh_vertices_num_y = m_num_ver_y;
        m_meshfusion_config.ldc_mesh->input_width         = m_perSensorData.sensorDimension.width;
        m_meshfusion_config.ldc_mesh->input_height        = m_perSensorData.sensorDimension.height;
        m_meshfusion_config.ldc_mesh->output_width        = m_perSensorData.sensorDimension.width;
        m_meshfusion_config.ldc_mesh->output_height       = m_perSensorData.sensorDimension.height;
        m_meshfusion_config.ldc_mesh->type                = 0; // 0 for pixel shifts, 1 for 3x3 matrix

        /* m_meshfusion_config.super_view_mesh->mesh_vertices_num_x = m_num_ver_x;
        m_meshfusion_config.super_view_mesh->mesh_vertices_num_y    = m_num_ver_y;
        m_meshfusion_config.super_view_mesh->input_width            = m_inputWidth;
        m_meshfusion_config.super_view_mesh->input_height           = m_inputHeight;
        m_meshfusion_config.super_view_mesh->output_width           = m_outputWidth;
        m_meshfusion_config.super_view_mesh->output_height          = m_outputHeight;
        m_meshfusion_config.super_view_mesh->type                   = 0; // 0 for pixel shifts, 1 for 3x3 matrix */

        m_meshfusion_config.output_mesh->mesh_vertices_num_x = m_num_ver_x;
        m_meshfusion_config.output_mesh->mesh_vertices_num_y = m_num_ver_y;
        m_meshfusion_config.output_mesh->input_width         = m_inputWidth;
        m_meshfusion_config.output_mesh->input_height        = m_inputHeight;
        m_meshfusion_config.output_mesh->output_width        = m_outputWidth;
        m_meshfusion_config.output_mesh->output_height       = m_outputHeight;
        m_meshfusion_config.output_mesh->type                = 0; // 0 for pixel shifts, 1 for 3x3 matrix

        m_meshfusion_config.eis_mesh->mesh_vertices_num_x = m_num_ver_x;
        m_meshfusion_config.eis_mesh->mesh_vertices_num_y = m_num_ver_y;
        m_meshfusion_config.eis_mesh->input_width         = m_inputWidth;
        m_meshfusion_config.eis_mesh->input_height        = m_inputHeight;
        m_meshfusion_config.eis_mesh->output_width        = m_outputWidth;
        m_meshfusion_config.eis_mesh->output_height       = m_outputHeight;
        m_meshfusion_config.eis_mesh->type                = 0; // 0 for pixel shifts, 1 for 3x3 matrix

         m_sensor_window.input_width    = m_perSensorData.active_array.width;
         m_sensor_window.input_height   = m_perSensorData.active_array.height;
         m_sensor_window.output_width   = m_perSensorData.sensorDimension.width;
         m_sensor_window.output_height  = m_perSensorData.sensorDimension.height;
         m_sensor_window.start_x        = m_perSensorData.sensorDimension.left;
         m_sensor_window.start_y        = m_perSensorData.sensorDimension.top;
         m_sensor_window.end_x          = m_sensor_window.start_x + m_sensor_window.output_width;
         m_sensor_window.end_y          = m_sensor_window.start_y + m_sensor_window.output_height;
         m_sensor_window.binning_en     = 0;
         m_sensor_window.hor_binning_en = 0;
         m_sensor_window.hblank         = m_perSensorData.llpclk - m_sensor_window.output_width;
         m_sensor_window.vblank         = m_perSensorData.fll - m_sensor_window.output_height;

         m_isp_window.input_width   = m_perSensorData.sensorDimension.width;
         m_isp_window.input_height  = m_perSensorData.sensorDimension.height;
         m_isp_window.output_width  = isp_out_width;
         m_isp_window.output_height = isp_out_height;
         m_isp_window.start_x       = temp_isp_start_x;
         m_isp_window.start_y       = temp_isp_start_y;
         m_isp_window.end_x         = temp_isp_end_x;
         m_isp_window.end_y         = temp_isp_end_y;
         m_isp_window.binning_en    = 0;
         m_isp_window.hblank        = 0;
         m_isp_window.vblank        = 0;

         result = m_meshFusion_lib_adapt_window(m_handle_Fusion, &m_meshfusion_config, &m_sensor_window, &m_isp_window);
         LOG_INFO(CamxLogGroupChi, "m_meshFusion_lib_adapt_window return %d", static_cast<int>(result));

    }
    else
    {
        LOG_INFO(CamxLogGroupChi, "Not Doing UpdateAdaptWindow for frame %d",(int)requestId);
    }
    return result;
}

////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
/// ChiImageWarpNode::ProcessRequest
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
CDKResult ChiImageWarpNode::ProcessRequest(
    CHINODEPROCESSREQUESTINFO* pProcessRequestInfo)
{
    CDKResult result = CDKResultSuccess;
    IMAGEWARPCALLBACK *p_cback = new IMAGEWARPCALLBACK;
    if (NULL == p_cback)
    {
        LOG_ERROR(CamxLogGroupChi, "failed: no memory");
        result = CDKResultEFailed;
    }
    else
    {

        m_outputWidth   = (*pProcessRequestInfo->phOutputBuffer)->format.width;
        m_outputHeight  = (*pProcessRequestInfo->phOutputBuffer)->format.height;

        if (ChiNodeCapsEISDGLDC == m_nodeCaps)
        {
            UpdateAdaptWindow(pProcessRequestInfo->frameNum);

            // m_meshfusion_config.eis_mesh->mapping = (mesh_one_entry_t*)malloc(sizeof(mesh_one_entry_t)*m_num_ver_x*m_num_ver_y); // Needed for Non-Array init in mesh_fusion.h

            // m_meshfusion_config.output_mesh->mapping = (mesh_one_entry_t*)malloc(sizeof(mesh_one_entry_t)*m_num_ver_x*m_num_ver_y); // Needed for Non-Array init in mesh_fusion.h


            //Try to remove the below expensive memcpy
            memcpy(m_meshfusion_config.eis_mesh->mapping, (*pProcessRequestInfo->phInputBuffer[1]).pImageList[0].pAddr[0], sizeof(float)*2*m_num_ver_x*m_num_ver_y);

            LOG_INFO(CamxLogGroupChi, "m_meshfusion_config.eis_mesh->mapping [2] %f, [3] %f [4] %f",
                *(reinterpret_cast<FLOAT*>(m_meshfusion_config.eis_mesh->mapping)+2),
                *(reinterpret_cast<FLOAT*>(m_meshfusion_config.eis_mesh->mapping)+3),
                *(reinterpret_cast<FLOAT*>(m_meshfusion_config.eis_mesh->mapping) + 4));

            // m_meshfusion_config.output_mesh->mapping = reinterpret_cast<mesh_one_entry_t*>((*pProcessRequestInfo->phInputBuffer[1]).pImageList[0].pAddr[0]);

            result = m_meshFusion_lib_process(m_handle_Fusion, &m_meshfusion_config);

            LOG_INFO(CamxLogGroupChi, "m_meshFusion_lib_process ReqId : %d  return %d", (int)pProcessRequestInfo->frameNum, static_cast<int>(result));

            /* LOG_INFO(CamxLogGroupChi, "mesh buf m_buff_bundle.mesh_buf.buf [0] %f, [1] %f [500] %f",
                *(reinterpret_cast<FLOAT*>(m_meshfusion_config.output_mesh->mapping)),
                *(reinterpret_cast<FLOAT*>(m_meshfusion_config.output_mesh->mapping)+1),
                *(reinterpret_cast<FLOAT*>(m_meshfusion_config.output_mesh->mapping) + 500));

            LOG_INFO(CamxLogGroupChi, "mesh buf m_buff_bundle.mesh_buf.buf [1000] %f, [5000] %f [12609] %f",
                *(reinterpret_cast<FLOAT*>(m_meshfusion_config.output_mesh->mapping)+ 1000),
                *(reinterpret_cast<FLOAT*>(m_meshfusion_config.output_mesh->mapping)+5000),
                *(reinterpret_cast<FLOAT*>(m_meshfusion_config.output_mesh->mapping) + 12609));
            */
            LOG_INFO(CamxLogGroupChi, "debug mesh buf m_buff_bundle.mesh_buf.buf [2] %f, [3] %f [4] %f",
                *(reinterpret_cast<FLOAT*>(m_meshfusion_config.output_mesh->mapping)+2),
                *(reinterpret_cast<FLOAT*>(m_meshfusion_config.output_mesh->mapping)+3),
                *(reinterpret_cast<FLOAT*>(m_meshfusion_config.output_mesh->mapping) + 4));


            //Try to remove the below expensive memcpy
            memcpy((*pProcessRequestInfo->phInputBuffer[1]).pImageList[0].pAddr[0] , m_meshfusion_config.output_mesh->mapping, sizeof(float)*2*m_num_ver_x*m_num_ver_y);
        }

        m_buff_bundle.input_buf_count      = 1;
        m_buff_bundle.output_buf_count     = 1;
        m_buff_bundle.mesh_buf_count       = 1;

        switch ((*pProcessRequestInfo->phInputBuffer)->format.format)
        {
            case YUV420NV12:
                m_buff_bundle.input_buf->type = IWARP_IMG_TYPE_NV12;
                break;

            case UBWCNV12:
                m_buff_bundle.input_buf->type = IWARP_IMG_TYPE_UBWC_NV12;
                break;

            default:
                LOG_ERROR(CamxLogGroupChi, "ReqId : %d ProcessRequest Unexpected Input format %d,"
                    " Continuing with NV12 input",
                    (int)pProcessRequestInfo->frameNum,
                    (*pProcessRequestInfo->phInputBuffer)->format.format);
                m_buff_bundle.input_buf->type = IWARP_IMG_TYPE_NV12;
                break;
        }

        switch ((*pProcessRequestInfo->phOutputBuffer)->format.format)
        {
            case YUV420NV12:
                m_buff_bundle.output_buf->type = IWARP_IMG_TYPE_NV12;
                break;

            case UBWCNV12:
                m_buff_bundle.output_buf->type = IWARP_IMG_TYPE_UBWC_NV12;
                break;

            case P010:
                m_buff_bundle.output_buf->type = IWARP_IMG_TYPE_P010;
                break;

            case UBWCTP10:
                m_buff_bundle.output_buf->type = IWARP_IMG_TYPE_UBWC_TP10;
                break;

            default:
                LOG_ERROR(CamxLogGroupChi, "ReqId : %d ProcessRequest Unexpected Output format %d,"
                    " Continuing with NV12 output",
                    (int)pProcessRequestInfo->frameNum,
                    (*pProcessRequestInfo->phOutputBuffer)->format.format);
                m_buff_bundle.output_buf->type = IWARP_IMG_TYPE_NV12;
                break;
        }

        m_buff_bundle.mesh_buf->type       = IWARP_IMG_TYPE_NON_IMG;

        switch (m_buff_bundle.input_buf->type)
        {
            case IWARP_IMG_TYPE_NV12:
                m_bytesperpixel_input = 1;
                break;

            case IWARP_IMG_TYPE_P010:
                m_bytesperpixel_input = 2;
                break;

            case IWARP_IMG_TYPE_TP10:
                m_bytesperpixel_input = 4/3;
                break;

            default:
                m_bytesperpixel_input = 1;
                break;
        }

        switch (m_buff_bundle.output_buf->type)
        {
            case IWARP_IMG_TYPE_NV12:
                m_bytesperpixel_output = 1;
                break;

            case IWARP_IMG_TYPE_P010:
                m_bytesperpixel_output = 2;
                break;

            case IWARP_IMG_TYPE_TP10:
                m_bytesperpixel_output = 4/3;
                break;

            default:
                m_bytesperpixel_output = 1;
                break;
        }

        m_buff_bundle.input_buf->width     = m_inputWidth;
        m_buff_bundle.input_buf->height    = m_inputHeight;
        m_buff_bundle.input_buf->stride    = ChiNodeUtils::AlignGeneric32(m_inputWidth, 128);
        m_buff_bundle.input_buf->stride_in_bytes = m_buff_bundle.input_buf->stride * m_bytesperpixel_input;
        m_buff_bundle.input_buf->scanline  = ChiNodeUtils::AlignGeneric32(m_inputHeight, 32);
        m_buff_bundle.input_buf->buf_size  = ((*pProcessRequestInfo->phInputBuffer[0]).planeSize[0] +
                                              (*pProcessRequestInfo->phInputBuffer[0]).planeSize[1]);
        m_buff_bundle.input_buf->fd        = (*pProcessRequestInfo->phInputBuffer[0]).pImageList[0].fd[0];
        m_buff_bundle.input_buf->buf       = (*pProcessRequestInfo->phInputBuffer[0]).pImageList[0].pAddr[0];

        LOG_INFO(CamxLogGroupChi, "ReqId : %d ProcessRequest input buf w=%d, h=%d, st=%d, scl=%d, buf_size=%d, buf=%p, fd=%d,"
            " format=%d, type=%d, bpp=%f",
            (int)pProcessRequestInfo->frameNum, m_buff_bundle.input_buf->width, m_buff_bundle.input_buf->height,
            m_buff_bundle.input_buf->stride, m_buff_bundle.input_buf->scanline, m_buff_bundle.input_buf->buf_size,
            m_buff_bundle.input_buf->buf, m_buff_bundle.input_buf->fd, (*pProcessRequestInfo->phInputBuffer)->format.format,
            m_buff_bundle.input_buf->type, m_bytesperpixel_input);

        m_buff_bundle.output_buf->width    = m_outputWidth;
        m_buff_bundle.output_buf->height   = m_outputHeight;
        m_buff_bundle.output_buf->stride   = ChiNodeUtils::AlignGeneric32(m_outputWidth, 128);
        m_buff_bundle.output_buf->stride_in_bytes = m_buff_bundle.output_buf->stride * m_bytesperpixel_output;
        m_buff_bundle.output_buf->scanline = ChiNodeUtils::AlignGeneric32(m_outputHeight, 32);
        m_buff_bundle.output_buf->buf_size = ((*pProcessRequestInfo->phOutputBuffer)->planeSize[0] +
                                              (*pProcessRequestInfo->phOutputBuffer)->planeSize[1]);
        m_buff_bundle.output_buf->fd       = (*pProcessRequestInfo->phOutputBuffer)->pImageList[0].fd[0];
        m_buff_bundle.output_buf->buf      = (*pProcessRequestInfo->phOutputBuffer)->pImageList[0].pAddr[0];

        LOG_INFO(CamxLogGroupChi, "ReqId : %d ProcessRequest output buf w=%d, h=%d, st=%d, scl=%d, buf_size=%d, buf=%p, fd=%d,"
            " format=%d, type=%d, bpp=%f",
            (int)pProcessRequestInfo->frameNum, m_buff_bundle.output_buf->width, m_buff_bundle.output_buf->height,
            m_buff_bundle.output_buf->stride, m_buff_bundle.output_buf->scanline, m_buff_bundle.output_buf->buf_size,
            m_buff_bundle.output_buf->buf, m_buff_bundle.output_buf->fd, (*pProcessRequestInfo->phOutputBuffer)->format.format,
            m_buff_bundle.output_buf->type, m_bytesperpixel_output);

        if ((ChiNodeCapsEISDG == m_nodeCaps) || (ChiNodeCapsEISDGLDC == m_nodeCaps))
        {
            m_buff_bundle.mesh_buf->fd  = (*pProcessRequestInfo->phInputBuffer[1]).pImageList[0].fd[0];
            m_buff_bundle.mesh_buf->buf = (*pProcessRequestInfo->phInputBuffer[1]).pImageList[0].pAddr[0];
            LOG_INFO(CamxLogGroupChi, "mesh buf w=%d, h=%d, st=%d, scl=%d, buf_size=%d, buf=%p,fd=%d",
                m_buff_bundle.mesh_buf->width, m_buff_bundle.mesh_buf->height, m_buff_bundle.mesh_buf->stride,
                m_buff_bundle.mesh_buf->scanline, m_buff_bundle.mesh_buf->buf_size,
                m_buff_bundle.mesh_buf->buf, m_buff_bundle.mesh_buf->fd);

            // Debug logs to check mesh buffer contents // To be removed later
            for(UINT l=0;l< 20;l=l+2)
            {
                LOG_INFO(CamxLogGroupChi, "mesh buf m_buff_bundle.mesh_buf [%d] %f, %f",
                    l, *(reinterpret_cast<FLOAT*>(m_buff_bundle.mesh_buf->buf)+l),
                    *(reinterpret_cast<FLOAT*>(m_buff_bundle.mesh_buf->buf)+l+1));
            }
        }

        p_cback->user_data_Node = this;

        m_buff_bundle.input_buf->stride_in_bytes  = m_buff_bundle.input_buf->stride * m_bytesperpixel_input;
        m_buff_bundle.output_buf->stride_in_bytes = m_buff_bundle.output_buf->stride * m_bytesperpixel_output;
        m_buff_bundle.mesh_buf->stride_in_bytes   = m_buff_bundle.mesh_buf->stride;

        m_buff_bundle.input_buf->cached_ion  = 0;
        m_buff_bundle.output_buf->cached_ion = 1;
        m_buff_bundle.mesh_buf->cached_ion   = 1;

        result = m_ImageWarp_lib_process(m_p_handle, &m_buff_bundle, p_cback);

        pProcessRequestInfo->isDelayedRequestDone = TRUE;

    }
    return result;
}

////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
/// ChiImageWarpNode::ImageWarpLibIonMalloc
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
VOID ChiImageWarpNode::ImageWarpLibIonMalloc(
    mmap_info_ion * p_ion_mmap_info)
{

    CDKResult  result = CDKResultSuccess;
    INT32      result_ion;
    IMGBUFFERT *pBuffer;
    struct ion_fd_data ion_info_fd;

    pBuffer = (IMGBUFFERT*)malloc(sizeof(IMGBUFFERT));
    if (NULL == pBuffer)
    {
        LOG_ERROR(CamxLogGroupChi, "malloc failed");
        result = CDKResultEFailed;
    }

    if (CDKResultSuccess == result && NULL == p_ion_mmap_info)
    {
        LOG_ERROR(CamxLogGroupChi, "mmap_info_ion pointer from library is NULL");
        result = CDKResultEFailed;
    }

    if (CDKResultSuccess == result && 0 >= p_ion_mmap_info->bufsize)
    {
        LOG_ERROR(CamxLogGroupChi, "mmap_info_ion bufsize from library is %d", p_ion_mmap_info->bufsize);
        result = CDKResultEFailed;
    }

    pBuffer->ionFd  = p_ion_mmap_info->ion_device_fd;

    if (CDKResultSuccess == result && 0 == p_ion_mmap_info->ion_device_fd)
    {
        LOG_ERROR(CamxLogGroupChi, "mmap_info_ion ion_device_fd from library is %d", p_ion_mmap_info->ion_device_fd);
        result = CDKResultEFailed;
    }

    if (CDKResultSuccess == result)
    {
        pBuffer->allocData.len          = (UINT)p_ion_mmap_info->bufsize;
        pBuffer->allocData.flags        = 0;
        pBuffer->allocData.align        = 4096;

        pBuffer->allocData.heap_id_mask = (0x1 << ION_SYSTEM_HEAP_ID);

        /* Make it page size aligned */
        pBuffer->allocData.len          = (pBuffer->allocData.len + 4095) & (~4095U);
        result_ion                = ioctl(pBuffer->ionFd, ION_IOC_ALLOC, &pBuffer->allocData);
        if (0 > result_ion)
        {
            LOG_ERROR(CamxLogGroupChi, "ioctl failure id : %d", result_ion);
            result = CDKResultEFailed;
        }
    }

    if (CDKResultSuccess == result)
    {
        memset(&ion_info_fd, 0, sizeof(ion_info_fd));
        ion_info_fd.handle = pBuffer->allocData.handle;

        result_ion = ioctl(pBuffer->ionFd, ION_IOC_SHARE, &ion_info_fd);
        if (0 > result_ion)
        {
            LOG_ERROR(CamxLogGroupChi, "ioctl failure id : %d", result_ion);
            result = CDKResultEFailed;
        }
    }

    if (CDKResultSuccess == result)
    {
        pBuffer->pAddr                  = (uint8_t*)mmap(NULL, pBuffer->allocData.len,
                                                         PROT_READ | PROT_WRITE,
                                                         MAP_SHARED, ion_info_fd.fd, 0);
        pBuffer->buffFd                 = ion_info_fd.fd;

        if (MAP_FAILED == pBuffer->pAddr)
        {
            LOG_ERROR(CamxLogGroupChi, "Failure 05");
            result = CDKResultEFailed;
        }
    }

    if (CDKResultSuccess == result)
    {
        pBuffer->cached                 = 0;

        p_ion_mmap_info->ion_fd         = pBuffer->buffFd;
        p_ion_mmap_info->virtual_addr   = (UCHAR*)pBuffer->pAddr;
    }
    else
    {
        LOG_ERROR(CamxLogGroupChi, "Unable to alloc Ion Memory for iwarp");
    }

    p_ion_mmap_info->user_handle = pBuffer;

}

////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
/// ChiImageWarpNode::ImageWarpLibIonFree
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
VOID ChiImageWarpNode::ImageWarpLibIonFree(
    mmap_info_ion * p_ion_mmap_info)
{

    CDKResult result = CDKResultSuccess;

    struct ion_handle_data handle_data;
    IMGBUFFERT*            pBuffer;

    if (NULL == p_ion_mmap_info)
    {
        LOG_ERROR(CamxLogGroupChi, "mmap_info_ion pointer from library is NULL");
        result = CDKResultEFailed;
    }

    if (CDKResultSuccess == result && 0 >= p_ion_mmap_info->bufsize)
    {
        LOG_ERROR(CamxLogGroupChi, "mmap_info_ion bufsize from library is %d", p_ion_mmap_info->bufsize);
        result = CDKResultEFailed;
    }

    if (CDKResultSuccess == result && 0 == p_ion_mmap_info->ion_fd)
    {
        LOG_ERROR(CamxLogGroupChi, "mmap_info_ion ion_fd from library is %d", p_ion_mmap_info->ion_fd);
        result = CDKResultEFailed;
    }

    if (CDKResultSuccess == result && NULL == p_ion_mmap_info->virtual_addr)
    {
        LOG_ERROR(CamxLogGroupChi, "mmap_info_ion virtual_addr from library is NULL");
        result = CDKResultEFailed;
    }

    /* ION buffer */
    if (CDKResultSuccess == result && NULL != p_ion_mmap_info->virtual_addr)
    {
        munmap(p_ion_mmap_info->virtual_addr, p_ion_mmap_info->bufsize);
    }

    if (CDKResultSuccess == result && 0 != p_ion_mmap_info->ion_fd)
    {
        result = close(p_ion_mmap_info->ion_fd);
    }

    if (CDKResultSuccess != result)
    {
        LOG_ERROR(CamxLogGroupChi,"Error %d: close bufferFd = %d", result, p_ion_mmap_info->ion_fd);
    }

    pBuffer = (IMGBUFFERT *)p_ion_mmap_info->user_handle;
    if (NULL != pBuffer)
    {
        handle_data.handle = pBuffer->allocData.handle;
        ioctl(p_ion_mmap_info->ion_fd, ION_IOC_FREE, &handle_data);
    }

    close(p_ion_mmap_info->ion_fd);
    free(pBuffer);
    pBuffer = NULL;

}

////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
/// ChiImageWarpNode::ImageWarpCompletionCallback
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
VOID ChiImageWarpNode::ImageWarpCompletionCallback(
    VOID * user_data,
    int err)
{

    CDKResult result     = CDKResultSuccess;
    IMAGEWARPCALLBACK* p_cback = (IMAGEWARPCALLBACK*)user_data;
    if (NULL == p_cback)
    {
        LOG_ERROR(CamxLogGroupChi, "ImageWarpCompletionCallback p_cback is NULL");
        result = CDKResultEFailed;
    }
    else
    {
        ChiImageWarpNode* pNode = reinterpret_cast<ChiImageWarpNode*>(p_cback->user_data_Node);

        pNode->m_processedFrame = pNode->m_processedFrame + 1;

        LOG_INFO(CamxLogGroupChi, "IMAGEWARP processed for m_processedFrame=%d", static_cast<UINT32>(pNode->m_processedFrame));

        CHINODEPROCESSREQUESTDONEINFO info;
        info.size                   = sizeof(CHINODEPROCESSREQUESTDONEINFO);
        info.frameNum               = pNode->m_processedFrame;

        if (LibiwarpCallBackSuccess == err)
        {
            info.result = CDKResultSuccess;
        }
        else
        {
            info.result = CDKResultEFailed;
            LOG_INFO(CamxLogGroupChi, "IMAGEWARP Callback returned error result %d for frame %d",
                err, static_cast<UINT32>(pNode->m_processedFrame));
        }

        info.hChiSession            = pNode->m_hChiSession;
        info.isEarlyMetadataDone    = FALSE;
        g_ChiNodeInterface.pProcessRequestDone(&info);
    }

}

////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
/// ChiImageWarpNode::PostPipelineCreate
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
CDKResult ChiImageWarpNode::PostPipelineCreate()
{

    LOG_INFO(CamxLogGroupChi, "PostPipelineCreate Entry:");

    CDKResult           result = CDKResultSuccess;
    VOID*               pData  = NULL;

    // Get Sensor Mount Angle
    pData = ChiNodeUtils::GetMetaData(0,
                                      ANDROID_SENSOR_ORIENTATION,
                                      ChiMetadataStatic,
                                      &g_ChiNodeInterface,
                                      m_hChiSession);
    if (NULL != pData)
    {
        LOG_INFO(CamxLogGroupChi, "sensor mount angle %d", *reinterpret_cast<UINT32*>(pData));
        m_perSensorData.mountAngle = *reinterpret_cast<UINT32*>(pData);
    }

    // Get Camera Position
    pData = ChiNodeUtils::GetMetaData(0,
                                      g_vendorTagId.cameraPositionTagId,
                                      ChiMetadataStatic,
                                      &g_ChiNodeInterface,
                                      m_hChiSession);
    if (NULL != pData)
    {
        m_perSensorData.cameraPosition = *reinterpret_cast<INT32 *>(pData);
        LOG_INFO(CamxLogGroupChi, "cameraPosition %d", *reinterpret_cast<INT32*>(pData));
    }

    // Get Sensor active array size
    pData = ChiNodeUtils::GetMetaData(0,
                                      ANDROID_SENSOR_INFO_ACTIVE_ARRAY_SIZE,
                                      ChiMetadataStatic,
                                      &g_ChiNodeInterface,
                                      m_hChiSession);
    if (NULL != pData)
    {
        CHIRECT* pActiveArray = reinterpret_cast<CHIRECT*>(pData);
        m_perSensorData.active_array.left   = pActiveArray->left;
        m_perSensorData.active_array.top    = pActiveArray->top;
        m_perSensorData.active_array.width  = pActiveArray->width;
        m_perSensorData.active_array.height = pActiveArray->height;
        LOG_INFO(CamxLogGroupChi, "sensor active array %d %d %d %d",
            pActiveArray->left,pActiveArray->top,
            pActiveArray->width,pActiveArray->height);
    }

    // Get Sensor Mode Info
    pData = ChiNodeUtils::GetMetaData(0,
                                      (g_vendorTagId.sensorInfoTagId | UsecaseMetadataSectionMask),
                                      ChiMetadataDynamic,
                                      &g_ChiNodeInterface,
                                      m_hChiSession);
    if (NULL != pData)
    {
        ChiSensorModeInfo* pSensorInfo = reinterpret_cast<ChiSensorModeInfo*>(pData);

        m_perSensorData.sensorDimension.left   = pSensorInfo->frameDimension.left;
        m_perSensorData.sensorDimension.top    = pSensorInfo->frameDimension.top;
        m_perSensorData.sensorDimension.width  = pSensorInfo->frameDimension.width;
        m_perSensorData.sensorDimension.height = pSensorInfo->frameDimension.height;
        m_perSensorData.targetFPS              = pSensorInfo->frameRate;
        m_perSensorData.fll                    = pSensorInfo->frameLengthLines;
        m_perSensorData.llpclk                 = pSensorInfo->lineLengthPixelClock;
        LOG_INFO(CamxLogGroupChi, "sensorDimension %d, %d %dx%d targetFPS %d fll %u llpclk %u",
            pSensorInfo->frameDimension.left,
            pSensorInfo->frameDimension.top,
            pSensorInfo->frameDimension.width,
            pSensorInfo->frameDimension.height,
            pSensorInfo->frameRate,
            pSensorInfo->frameLengthLines,
            pSensorInfo->lineLengthPixelClock);
    }
    else
    {
        LOG_ERROR(CamxLogGroupChi, "Sensor Data is NULL");
    }

    return result;
}


