////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
/// ChiImageWarpNode::LoadLib
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
CDKResult ChiImageWarpNode::LoadLib()
{
    CDKResult result = CDKResultSuccess;

    m_hImageWarpLib = ChiNodeUtils::LibMap(pLibName, pLibPath);

    if (NULL == m_hImageWarpLib)
    {
        LOG_ERROR(CamxLogGroupChi, "Error loading lib %s", pLibName);
        result = CDKResultEUnableToLoad;
    }

    ///< Map function pointers
    if (CDKResultSuccess == result)
    {
        m_ImageWarp_lib_init = reinterpret_cast<IMAGEWARPLIBINIT>(ChiNodeUtils::LibGetAddr(m_hImageWarpLib,
                                                                                               "image_warping_init"));

        m_ImageWarp_lib_process = reinterpret_cast<IMAGEWARPLIBPROCESS>(ChiNodeUtils::LibGetAddr(m_hImageWarpLib,
                                                                                               "image_warping_process"));

        m_ImageWarp_lib_deinit = reinterpret_cast<IMAGEWARPLIBDEINIT>(ChiNodeUtils::LibGetAddr(m_hImageWarpLib,
                                                                                                 "image_warping_deinit"));

        if ((NULL == m_ImageWarp_lib_init)       ||
            (NULL == m_ImageWarp_lib_process)    ||
            (NULL == m_ImageWarp_lib_deinit))
        {
            LOG_ERROR(CamxLogGroupChi,
                      "Error Initializing one or more function pointers in Library");
            result = CDKResultENoSuch;
        }
    }

    if ((CDKResultSuccess == result) && (ChiNodeCapsEISDGLDC == m_nodeCaps))
    {
        m_hmeshFusionLib = ChiNodeUtils::LibMap(pFusionLibName, pLibPath);

        if (NULL == m_hmeshFusionLib)
        {
            LOG_ERROR(CamxLogGroupChi, "Error loading lib %s", pFusionLibName);
            result = CDKResultEUnableToLoad;
        }

        ///< Map function pointers
        if (CDKResultSuccess == result)
        {
            m_meshFusion_lib_init = reinterpret_cast<MESHFUSIONLIBINIT>(ChiNodeUtils::LibGetAddr(m_hmeshFusionLib,
                                                                                               "mesh_fusion_init"));

            m_meshFusion_lib_adapt_window = reinterpret_cast<MESHFUSIONLIBADAPTWINDOW>(ChiNodeUtils::LibGetAddr(m_hmeshFusionLib,
                                                                                               "mesh_fusion_adapt_window"));

            m_meshFusion_lib_process = reinterpret_cast<MESHFUSIONLIBPROCESS>(ChiNodeUtils::LibGetAddr(m_hmeshFusionLib,
                                                                                                 "mesh_fusion"));

            m_meshFusion_lib_deinit = reinterpret_cast<MESHFUSIONLIBDEINIT>(ChiNodeUtils::LibGetAddr(m_hmeshFusionLib,
                                                                                             "mesh_fusion_deinit"));

            if ((NULL == m_meshFusion_lib_init)           ||
                (NULL == m_meshFusion_lib_adapt_window)   ||
                (NULL == m_meshFusion_lib_process)        ||
                (NULL == m_meshFusion_lib_deinit))
            {
                LOG_ERROR(CamxLogGroupChi,
                          "Error Initializing one or more function pointers in Library");
                result = CDKResultENoSuch;
            }
        }

    }
    return result;
}

